import React, { Component } from 'react';
import Square from './Square.js'

class Map extends Component {
	render() {
		return (
		<div className="Map">
			<header className="map-header">
				<h3> This is the map lol </h3>
			</header>
			< Square />
			< Square />
			< Square />
			< Square />
		</div>
		);
	}
}

export default Map;
